import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Header = () => {
  return (
    <Container>
      <StyledLink to="/">
        <Logo src="/connecter-logo-preview.png" alt="Connecter Logo" />
      </StyledLink>
    </Container>
  );
};

const Container = styled.header`
  display: flex;
  align-items: center;
  background-color: #fff; /* Defina a cor de fundo desejada */
  height: 105px;
  padding: 0 2rem; /* Adiciona um pouco de preenchimento, se necessário */
`;

const StyledLink = styled(Link)`
  text-decoration: none; /* Remove o sublinhado padrão do link */
`;

const Logo = styled.img`
  width: 180px; /* Ajuste o tamanho conforme necessário */
  margin-left: 0; /* Remove qualquer margem à esquerda */
`;

export default Header;
